import{_ as e,c as r,o as d,a as t}from"./app.434af41f.js";const _=JSON.parse('{"title":"Scheduler \u5B9E\u73B0\u539F\u7406","description":"","frontmatter":{},"headers":[{"level":2,"title":"\u57FA\u672C\u6982\u5FF5","slug":"\u57FA\u672C\u6982\u5FF5"},{"level":2,"title":"\u539F\u7406\u6982\u8FF0","slug":"\u539F\u7406\u6982\u8FF0"},{"level":2,"title":"\u4EFB\u52A1\u961F\u5217\u7BA1\u7406","slug":"\u4EFB\u52A1\u961F\u5217\u7BA1\u7406"},{"level":2,"title":"\u5982\u4F55\u533A\u5206\u4EFB\u52A1\u662F\u5426\u8FC7\u671F","slug":"\u5982\u4F55\u533A\u5206\u4EFB\u52A1\u662F\u5426\u8FC7\u671F"},{"level":2,"title":"\u4E0D\u540C\u961F\u5217\u4E2D\u7684\u4EFB\u52A1\u5982\u4F55\u6392\u5E8F\uFF1F","slug":"\u4E0D\u540C\u961F\u5217\u4E2D\u7684\u4EFB\u52A1\u5982\u4F55\u6392\u5E8F\uFF1F"},{"level":2,"title":"\u4EFB\u52A1\u5165\u961F\u4E24\u4E2A\u961F\u5217\uFF0C\u4F1A\u53D1\u751F\u4EC0\u4E48\uFF1F","slug":"\u4EFB\u52A1\u5165\u961F\u4E24\u4E2A\u961F\u5217\uFF0C\u4F1A\u53D1\u751F\u4EC0\u4E48\uFF1F"},{"level":2,"title":"\u5355\u4E2A\u4EFB\u52A1\u7684\u4E2D\u65AD\u4EE5\u53CA\u6062\u590D","slug":"\u5355\u4E2A\u4EFB\u52A1\u7684\u4E2D\u65AD\u4EE5\u53CA\u6062\u590D"},{"level":2,"title":"\u539F\u7406\u5C0F\u7ED3","slug":"\u539F\u7406\u5C0F\u7ED3"},{"level":2,"title":"\u53C2\u8003\u8D44\u6599","slug":"\u53C2\u8003\u8D44\u6599"}],"relativePath":"pages/react/hard/scheduler/scheduler-origin.md"}'),c={name:"pages/react/hard/scheduler/scheduler-origin.md"},o=t('<h1 id="scheduler-\u5B9E\u73B0\u539F\u7406" tabindex="-1">Scheduler \u5B9E\u73B0\u539F\u7406 <a class="header-anchor" href="#scheduler-\u5B9E\u73B0\u539F\u7406" aria-hidden="true">#</a></h1><div class="info custom-block"><p class="custom-block-title">INFO</p><p>\u7EC8\u4E8E\u5F00\u59CB\u5199\u8FD9\u7BC7\u4E86\uFF0C\u53EA\u60F3\u5FEB\u5FEB\u7684\u628A\u8FD9\u4E2A\u7CFB\u5217\u6536\u5C3E\u4E86\uFF0C\u8FD9\u7BC7\u6587\u7AE0\u53EF\u80FD\u4F1A\u5F15\u7528\u6BD4\u8F83\u591A\u7684\u5185\u5BB9\uFF0C\u5929\u8272\u5DF2\u665A\uFF0C\u4E0D\u5B9C\u4E45\u7559</p></div><p>\u5728\u6B63\u5F0F\u5F00\u59CB <code>Scheduler</code> \u6E90\u7801\u524D\uFF0C\u5148\u6765\u7B80\u5355\u7684\u4E86\u89E3\u4E00\u4E0B <code>Scheduler</code> \u7684\u4F5C\u7528\u4EE5\u53CA\u5B83\u4EA7\u751F\u7684\u610F\u4E49</p><p><code>Scheduler</code> \u662F\u4E00\u4E2A<strong>\u4EFB\u52A1\u8C03\u5EA6\u5668</strong>\uFF0C\u5B83\u4F1A\u6839\u636E\u4EFB\u52A1\u7684<strong>\u4F18\u5148\u7EA7</strong>\u5BF9\u4EFB\u52A1\u8FDB\u884C\u8C03\u7528\u6267\u884C\u3002 \u5728\u6709\u591A\u4E2A\u4EFB\u52A1\u7684\u60C5\u51B5\u4E0B\uFF0C\u5B83<strong>\u4F1A\u5148\u6267\u884C\u4F18\u5148\u7EA7\u9AD8</strong>\u7684\u4EFB\u52A1\u3002\u5982\u679C\u4E00\u4E2A\u4EFB\u52A1\u6267\u884C\u7684\u65F6\u95F4\u8FC7\u957F\uFF0C <code>Scheduler</code> \u4F1A\u4E2D\u65AD\u5F53\u524D\u4EFB\u52A1\uFF0C\u8BA9\u51FA\u7EBF\u7A0B\u7684\u6267\u884C\u6743\uFF0C<strong>\u907F\u514D\u9020\u6210\u7528\u6237\u64CD\u4F5C\u65F6\u754C\u9762\u7684\u5361\u987F</strong>\u3002\u5728\u4E0B\u4E00\u6B21\u6062\u590D\u672A\u5B8C\u6210\u7684\u4EFB\u52A1\u7684\u6267\u884C\u3002</p><div class="warning custom-block"><p class="custom-block-title">\u6269\u5C55</p><p>Scheduler \u4F5C\u4E3A\u4E00\u4E2A\u72EC\u7ACB\u7684\u5305\uFF0C\u53EF\u4EE5\u72EC\u81EA\u627F\u62C5\u8D77<strong>\u4EFB\u52A1\u8C03\u5EA6</strong>\u7684\u804C\u8D23\uFF0C\u4F60\u53EA\u9700\u8981\u5C06\u4EFB\u52A1\u548C\u4EFB\u52A1\u7684\u4F18\u5148\u7EA7\u4EA4\u7ED9\u5B83\uFF0C\u5B83\u5C31\u53EF\u4EE5\u5E2E\u4F60\u7BA1\u7406\u4EFB\u52A1\uFF0C\u5B89\u6392\u4EFB\u52A1\u7684\u6267\u884C\u3002\u8FD9\u5C31\u662F React \u548C Scheduler \u914D\u5408\u5DE5\u4F5C\u7684\u6A21\u5F0F\u3002 \u5BF9\u4E8E\u591A\u4E2A\u4EFB\u52A1\uFF0C\u5B83\u4F1A\u5148\u6267\u884C\u4F18\u5148\u7EA7\u9AD8\u7684\uFF0C\u5BF9\u4E8E\u5355\u4E2A\u4EFB\u52A1\uFF0C\u5B83\u4F1A\u6709\u8282\u5236\u5730\u53BB\u6267\u884C\u3002\u6362\u53E5\u8BDD\u8BF4\uFF0C<strong>\u7EBF\u7A0B\u53EA\u6709\u4E00\u4E2A\uFF0C\u5B83\u4E0D\u4F1A\u4E00\u76F4\u5360\u7528\u7740\u7EBF\u7A0B\u53BB\u6267\u884C\u4EFB\u52A1</strong>\u3002\u800C\u662F\u6267\u884C\u4E00\u4F1A\uFF0C\u4E2D\u65AD\u4E00\u4E0B\uFF0C\u5982\u6B64\u5F80\u590D\u3002 \u7528\u8FD9\u6837\u7684\u6A21\u5F0F\uFF0C\u6765\u907F\u514D\u4E00\u76F4\u5360\u7528\u6709\u9650\u7684\u8D44\u6E90\u6267\u884C\u8017\u65F6\u8F83\u957F\u7684\u4EFB\u52A1\uFF0C\u89E3\u51B3\u7528\u6237\u64CD\u4F5C\u65F6\u9875\u9762\u5361\u987F\u7684\u95EE\u9898\uFF0C\u5B9E\u73B0\u66F4\u5FEB\u7684\u54CD\u5E94\u3002</p></div><h2 id="\u57FA\u672C\u6982\u5FF5" tabindex="-1">\u57FA\u672C\u6982\u5FF5 <a class="header-anchor" href="#\u57FA\u672C\u6982\u5FF5" aria-hidden="true">#</a></h2><p>\u4E3A\u4E86\u5B9E\u73B0\u53EF\u4E2D\u65AD\u7684\u66F4\u65B0\uFF0CScheduler \u4E2D\u5F15\u5165\u4E86\u4E24\u4E2A\u91CD\u8981\u7684\u6982\u5FF5\uFF1A\u4EFB\u52A1\u4F18\u5148\u7EA7\u548C\u65F6\u95F4\u7247</p><ul><li>\u4EFB\u52A1\u4F18\u5148\u7EA7\u8BA9\u4EFB\u52A1\u6309\u7167\u81EA\u8EAB\u7684\u7D27\u6025\u7A0B\u5EA6\u6392\u5E8F\uFF0C\u8FD9\u6837\u53EF\u4EE5<strong>\u8BA9\u4F18\u5148\u7EA7\u6700\u9AD8\u7684\u4EFB\u52A1\u6700\u5148\u88AB\u6267\u884C\u5230</strong>\uFF0C\u5E76\u62E5\u6709\u6253\u65AD\u4F4E\u4F18\u5148\u7EA7\u4EFB\u52A1\u7684\u80FD\u529B</li><li>\u65F6\u95F4\u7247\u89C4\u5B9A\u7684\u662F\u5355\u4E2A\u4EFB\u52A1\u5728\u8FD9\u4E00\u5E27\u5185\u6700\u5927\u7684\u6267\u884C\u65F6\u95F4\uFF0C\u4EFB\u52A1\u4E00\u65E6\u6267\u884C\u65F6\u95F4\u8D85\u8FC7\u65F6\u95F4\u7247\uFF0C\u5219\u4F1A\u88AB\u6253\u65AD\uFF0C\u6709\u8282\u5236\u5730\u6267\u884C\u4EFB\u52A1\u3002\u8FD9\u6837\u53EF\u4EE5\u4FDD\u8BC1\u9875\u9762\u4E0D\u4F1A\u56E0\u4E3A\u4EFB\u52A1\u8FDE\u7EED\u6267\u884C\u7684\u65F6\u95F4\u8FC7\u957F\u800C\u4EA7\u751F\u5361\u987F</li></ul><h2 id="\u539F\u7406\u6982\u8FF0" tabindex="-1">\u539F\u7406\u6982\u8FF0 <a class="header-anchor" href="#\u539F\u7406\u6982\u8FF0" aria-hidden="true">#</a></h2><p>\u57FA\u4E8E<strong>\u4EFB\u52A1\u4F18\u5148\u7EA7\u548C\u65F6\u95F4\u7247</strong>\u7684\u6982\u5FF5\uFF0CScheduler \u56F4\u7ED5\u7740\u5B83\u7684\u6838\u5FC3\u76EE\u6807 - \u4EFB\u52A1\u8C03\u5EA6\uFF0C\u884D\u751F\u51FA\u4E86\u4E24\u5927\u6838\u5FC3\u529F\u80FD\uFF1A<strong>\u4EFB\u52A1\u961F\u5217\u7BA1\u7406 \u548C \u65F6\u95F4\u7247\u4E0B\u4EFB\u52A1\u7684\u4E2D\u65AD\u548C\u6062\u590D</strong>\u3002</p><p>\u90A3\u4E48\u5C31\u6709\u4E86\u8FD9\u4E24\u4E2A\u95EE\u9898\uFF1F</p><ul><li>\u4EFB\u52A1\u961F\u5217\u662F\u5982\u4F55\u7BA1\u7406\u7684\uFF1F</li><li>\u4EFB\u52A1\u662F\u600E\u4E48\u6267\u884C\u7684\uFF0C\u6267\u884C\u65F6\u662F\u600E\u4E48\u88AB\u4E2D\u65AD\u7684\uFF0C\u7136\u540E\u53C8\u662F\u600E\u4E48\u6062\u590D\u6267\u884C\u7684\uFF1F</li></ul><h2 id="\u4EFB\u52A1\u961F\u5217\u7BA1\u7406" tabindex="-1">\u4EFB\u52A1\u961F\u5217\u7BA1\u7406 <a class="header-anchor" href="#\u4EFB\u52A1\u961F\u5217\u7BA1\u7406" aria-hidden="true">#</a></h2><p>\u4EFB\u52A1\u961F\u5217\u7BA1\u7406\u5BF9\u5E94\u4E86 <code>Scheduler</code> \u7684\u591A\u4EFB\u52A1\u7BA1\u7406\u8FD9\u4E00\u884C\u4E3A\u3002\u5728 <code>Scheduler</code> \u5185\u90E8\uFF0C\u628A\u4EFB\u52A1\u5206\u6210\u4E86\u4E24\u79CD\uFF1A<strong>\u672A\u8FC7\u671F\u7684\u548C\u5DF2\u8FC7\u671F\u7684</strong>\uFF0C\u5206\u522B\u7528\u4E24\u4E2A\u961F\u5217\u5B58\u50A8</p><ul><li>\u524D\u8005\u5B58\u5230 <code>timerQueue</code> \u4E2D</li><li>\u540E\u8005\u5B58\u5230 <code>taskQueue</code> \u4E2D\u3002</li></ul><h2 id="\u5982\u4F55\u533A\u5206\u4EFB\u52A1\u662F\u5426\u8FC7\u671F" tabindex="-1">\u5982\u4F55\u533A\u5206\u4EFB\u52A1\u662F\u5426\u8FC7\u671F <a class="header-anchor" href="#\u5982\u4F55\u533A\u5206\u4EFB\u52A1\u662F\u5426\u8FC7\u671F" aria-hidden="true">#</a></h2><p>\u7528\u4EFB\u52A1\u7684\u5F00\u59CB\u65F6\u95F4\uFF08startTime\uFF09\u548C\u5F53\u524D\u65F6\u95F4\uFF08currentTime\uFF09\u4F5C\u6BD4\u8F83\u3002</p><ul><li>\u5F00\u59CB\u65F6\u95F4\u5927\u4E8E\u5F53\u524D\u65F6\u95F4\uFF0C\u8BF4\u660E\u672A\u8FC7\u671F\uFF0C\u653E\u5230 <code>timerQueue</code></li><li>\u5F00\u59CB\u65F6\u95F4\u5C0F\u4E8E\u7B49\u4E8E\u5F53\u524D\u65F6\u95F4\uFF0C\u8BF4\u660E\u5DF2\u8FC7\u671F\uFF0C\u653E\u5230 <code>taskQueue</code></li></ul><h2 id="\u4E0D\u540C\u961F\u5217\u4E2D\u7684\u4EFB\u52A1\u5982\u4F55\u6392\u5E8F\uFF1F" tabindex="-1">\u4E0D\u540C\u961F\u5217\u4E2D\u7684\u4EFB\u52A1\u5982\u4F55\u6392\u5E8F\uFF1F <a class="header-anchor" href="#\u4E0D\u540C\u961F\u5217\u4E2D\u7684\u4EFB\u52A1\u5982\u4F55\u6392\u5E8F\uFF1F" aria-hidden="true">#</a></h2><p>\u5F53\u4EFB\u52A1\u4E00\u4E2A\u4E2A\u5165\u961F\u7684\u65F6\u5019\uFF0C\u81EA\u7136\u8981\u5BF9\u5B83\u4EEC\u8FDB\u884C\u6392\u5E8F\uFF0C\u4FDD\u8BC1<strong>\u7D27\u6025\u7684\u4EFB\u52A1\u6392\u5728\u524D\u9762</strong>\uFF0C\u6240\u4EE5\u6392\u5E8F\u7684\u4F9D\u636E\u5C31\u662F\u4EFB\u52A1\u7684\u7D27\u6025\u7A0B\u5EA6\u3002\u800C <code>taskQueue</code> \u548C <code>timerQueue</code> \u4E2D\u4EFB\u52A1\u7D27\u6025\u7A0B\u5EA6\u7684\u5224\u5B9A\u6807\u51C6\u662F\u6709\u533A\u522B\u7684\u3002</p><ul><li><p><code>taskQueue</code> \u4E2D\uFF0C\u4F9D\u636E\u4EFB\u52A1\u7684\u8FC7\u671F\u65F6\u95F4\uFF08expirationTime\uFF09\u6392\u5E8F\uFF0C\u8FC7\u671F\u65F6\u95F4\u8D8A\u65E9\uFF0C\u8BF4\u660E\u8D8A\u7D27\u6025\uFF0C\u8FC7\u671F\u65F6\u95F4\u5C0F\u7684\u6392\u5728\u524D\u9762\u3002\u8FC7\u671F\u65F6\u95F4\u6839\u636E\u4EFB\u52A1\u4F18\u5148\u7EA7\u8BA1\u7B97\u5F97\u51FA\uFF0C\u4F18\u5148\u7EA7\u8D8A\u9AD8\uFF0C\u8FC7\u671F\u65F6\u95F4\u8D8A\u65E9\u3002</p></li><li><p><code>timerQueue</code> \u4E2D\uFF0C\u4F9D\u636E\u4EFB\u52A1\u7684\u5F00\u59CB\u65F6\u95F4\uFF08startTime\uFF09\u6392\u5E8F\uFF0C\u5F00\u59CB\u65F6\u95F4\u8D8A\u65E9\uFF0C\u8BF4\u660E\u4F1A\u8D8A\u65E9\u5F00\u59CB\uFF0C\u5F00\u59CB\u65F6\u95F4\u5C0F\u7684\u6392\u5728\u524D\u9762\u3002\u4EFB\u52A1\u8FDB\u6765\u7684\u65F6\u5019\uFF0C\u5F00\u59CB\u65F6\u95F4\u9ED8\u8BA4\u662F\u5F53\u524D\u65F6\u95F4\uFF0C\u5982\u679C\u8FDB\u5165\u8C03\u5EA6\u7684\u65F6\u5019\u4F20\u4E86\u5EF6\u8FDF\u65F6\u95F4\uFF0C\u5F00\u59CB\u65F6\u95F4\u5219\u662F\u5F53\u524D\u65F6\u95F4\u4E0E\u5EF6\u8FDF\u65F6\u95F4\u7684\u548C\u3002</p></li></ul><h2 id="\u4EFB\u52A1\u5165\u961F\u4E24\u4E2A\u961F\u5217\uFF0C\u4F1A\u53D1\u751F\u4EC0\u4E48\uFF1F" tabindex="-1">\u4EFB\u52A1\u5165\u961F\u4E24\u4E2A\u961F\u5217\uFF0C\u4F1A\u53D1\u751F\u4EC0\u4E48\uFF1F <a class="header-anchor" href="#\u4EFB\u52A1\u5165\u961F\u4E24\u4E2A\u961F\u5217\uFF0C\u4F1A\u53D1\u751F\u4EC0\u4E48\uFF1F" aria-hidden="true">#</a></h2><p>\u5982\u679C\u653E\u5230\u4E86 <code>taskQueue</code>\uFF0C\u90A3\u4E48<strong>\u7ACB\u5373\u8C03\u5EA6</strong>\u4E00\u4E2A\u51FD\u6570\u53BB\u5FAA\u73AF <code>taskQueue</code>\uFF0C\u6328\u4E2A\u6267\u884C\u91CC\u9762\u7684\u4EFB\u52A1\u3002</p><p>\u5982\u679C\u653E\u5230\u4E86 <code>timerQueue</code>\uFF0C\u90A3\u4E48\u8BF4\u660E\u5B83\u91CC\u9762\u7684\u4EFB\u52A1\u90FD\u4E0D\u4F1A\u7ACB\u5373\u6267\u884C\uFF0C\u90A3\u5C31\u7B49\u5230\u4E86 <code>timerQueue</code> \u91CC\u9762\u6392\u5728\u7B2C\u4E00\u4E2A\u4EFB\u52A1\u7684\u5F00\u59CB\u65F6\u95F4\uFF0C\u770B\u8FD9\u4E2A<strong>\u4EFB\u52A1\u662F\u5426\u8FC7\u671F</strong>\uFF0C</p><ul><li>\u5982\u679C\u662F\uFF0C\u5219\u628A\u4EFB\u52A1\u4ECE <code>timerQueue</code> \u4E2D\u62FF\u51FA\u6765\u653E\u5165 <code>taskQueue</code> \uFF0C\u8C03\u5EA6\u4E00\u4E2A\u51FD\u6570\u53BB\u5FAA\u73AF\u5B83\uFF0C\u6267\u884C\u6389\u91CC\u9762\u7684\u4EFB\u52A1\uFF1B</li><li>\u5426\u5219\u8FC7\u4E00\u4F1A\u7EE7\u7EED\u68C0\u67E5\u8FD9\u7B2C\u4E00\u4E2A\u4EFB\u52A1\u662F\u5426\u8FC7\u671F\u3002</li></ul><p>\u4EFB\u52A1\u961F\u5217\u7BA1\u7406\u76F8\u5BF9\u4E8E\u5355\u4E2A\u4EFB\u52A1\u7684\u6267\u884C\uFF0C\u662F\u5B8F\u89C2\u5C42\u9762\u7684\u6982\u5FF5\uFF0C\u5B83<strong>\u5229\u7528\u4EFB\u52A1\u7684\u4F18\u5148\u7EA7\u53BB\u7BA1\u7406\u4EFB\u52A1\u961F\u5217\u4E2D\u7684\u4EFB\u52A1\u987A\u5E8F\uFF0C\u59CB\u7EC8\u8BA9\u6700\u7D27\u6025\u7684\u4EFB\u52A1\u88AB\u4F18\u5148\u5904\u7406\u3002</strong></p><h2 id="\u5355\u4E2A\u4EFB\u52A1\u7684\u4E2D\u65AD\u4EE5\u53CA\u6062\u590D" tabindex="-1">\u5355\u4E2A\u4EFB\u52A1\u7684\u4E2D\u65AD\u4EE5\u53CA\u6062\u590D <a class="header-anchor" href="#\u5355\u4E2A\u4EFB\u52A1\u7684\u4E2D\u65AD\u4EE5\u53CA\u6062\u590D" aria-hidden="true">#</a></h2><p>\u5355\u4E2A\u4EFB\u52A1\u7684\u4E2D\u65AD\u4EE5\u53CA\u6062\u590D\u5BF9\u5E94\u4E86 <code>Scheduler</code> \u7684\u5355\u4E2A\u4EFB\u52A1\u6267\u884C\u63A7\u5236\u8FD9\u4E00\u884C\u4E3A\u3002\u5728\u5FAA\u73AF <code>taskQueue</code> \u6267\u884C\u6BCF\u4E00\u4E2A\u4EFB\u52A1\u65F6\uFF0C\u5982\u679C\u67D0\u4E2A\u4EFB\u52A1\u6267\u884C\u65F6\u95F4\u8FC7\u957F\uFF0C\u8FBE\u5230\u4E86\u65F6\u95F4\u7247\u9650\u5236\u7684\u65F6\u95F4\uFF0C\u90A3\u4E48\u8BE5\u4EFB\u52A1\u5FC5\u987B\u4E2D\u65AD\uFF0C\u4EE5\u4FBF\u4E8E\u8BA9\u4F4D\u7ED9\u66F4\u91CD\u8981\u7684\u4E8B\u60C5\uFF08\u5982\u6D4F\u89C8\u5668\u7ED8\u5236\uFF09\uFF0C\u7B49\u4E8B\u60C5\u5B8C\u6210\uFF0C\u518D\u6062\u590D\u6267\u884C\u4EFB\u52A1\u3002</p><div class="info custom-block"><p class="custom-block-title">\u63D0\u95EE</p><p>Scheduler\u8981\u5B9E\u73B0\u8FD9\u6837\u7684\u8C03\u5EA6\u6548\u679C\u9700\u8981\u4E24\u4E2A\u89D2\u8272\uFF1A<strong>\u4EFB\u52A1\u7684\u8C03\u5EA6\u8005\u3001\u4EFB\u52A1\u7684\u6267\u884C\u8005</strong>\u3002</p><p>\u8C03\u5EA6\u8005\u8C03\u5EA6\u4E00\u4E2A\u6267\u884C\u8005\uFF0C\u6267\u884C\u8005\u53BB\u5FAA\u73AFtaskQueue\uFF0C\u9010\u4E2A\u6267\u884C\u4EFB\u52A1\u3002\u5F53\u67D0\u4E2A\u4EFB\u52A1\u7684\u6267\u884C\u65F6\u95F4\u6BD4\u8F83\u957F\uFF0C\u6267\u884C\u8005\u4F1A\u6839\u636E\u65F6\u95F4\u7247\u4E2D\u65AD\u4EFB\u52A1\u6267\u884C\uFF0C\u7136\u540E\u544A\u8BC9\u8C03\u5EA6\u8005\uFF1A\u6211\u73B0\u5728\u6B63\u6267\u884C\u7684\u8FD9\u4E2A\u4EFB\u52A1\u88AB\u4E2D\u65AD\u4E86\uFF0C\u8FD8\u6709\u4E00\u90E8\u5206\u6CA1\u5B8C\u6210\uFF0C\u4F46\u73B0\u5728\u5FC5\u987B\u8BA9\u4F4D\u7ED9\u66F4\u91CD\u8981\u7684\u4E8B\u60C5\uFF0C\u4F60\u518D\u8C03\u5EA6\u4E00\u4E2A\u6267\u884C\u8005\u5427\uFF0C\u597D\u8BA9\u8FD9\u4E2A\u4EFB\u52A1\u80FD\u5728\u4E4B\u540E\u88AB\u7EE7\u7EED\u6267\u884C\u5B8C\uFF08\u4EFB\u52A1\u7684\u6062\u590D\uFF09\u3002</p><p>\u4E8E\u662F\uFF0C\u8C03\u5EA6\u8005\u77E5\u9053\u4E86\u4EFB\u52A1\u8FD8\u6CA1\u5B8C\u6210\uFF0C\u9700\u8981\u7EE7\u7EED\u505A\uFF0C\u5B83\u4F1A\u518D\u8C03\u5EA6\u4E00\u4E2A\u6267\u884C\u8005\u53BB\u7EE7\u7EED\u5B8C\u6210\u8FD9\u4E2A\u4EFB\u52A1\u3002</p></div><p><strong>\u901A\u8FC7\u6267\u884C\u8005\u548C\u8C03\u5EA6\u8005\u7684\u914D\u5408\uFF0C\u53EF\u4EE5\u5B9E\u73B0\u4EFB\u52A1\u7684\u4E2D\u65AD\u548C\u6062\u590D\u3002</strong></p><h2 id="\u539F\u7406\u5C0F\u7ED3" tabindex="-1">\u539F\u7406\u5C0F\u7ED3 <a class="header-anchor" href="#\u539F\u7406\u5C0F\u7ED3" aria-hidden="true">#</a></h2><p><code>Scheduler</code> \u7BA1\u7406\u7740 <code>taskQueue</code> \u548C <code>timerQueue</code> \u4E24\u4E2A\u961F\u5217\uFF0C\u5B83\u4F1A\u5B9A\u671F\u5C06 <code>timerQueue</code> \u4E2D\u7684\u8FC7\u671F\u4EFB\u52A1\u653E\u5230 <code>taskQueue</code> \u4E2D\uFF0C\u7136\u540E\u8BA9\u8C03\u5EA6\u8005\u901A\u77E5\u6267\u884C\u8005\u5FAA\u73AF <code>taskQueue</code> \u6267\u884C\u6389\u6BCF\u4E00\u4E2A\u4EFB\u52A1\u3002</p><p>\u6267\u884C\u8005\u63A7\u5236\u7740\u6BCF\u4E2A\u4EFB\u52A1\u7684\u6267\u884C\uFF0C<strong>\u4E00\u65E6\u67D0\u4E2A\u4EFB\u52A1\u7684\u6267\u884C\u65F6\u95F4\u8D85\u51FA\u65F6\u95F4\u7247\u7684\u9650\u5236\uFF0C\u5C31\u4F1A\u88AB\u4E2D\u65AD</strong>\uFF0C\u7136\u540E\u5F53\u524D\u7684\u6267\u884C\u8005\u9000\u573A\uFF0C\u9000\u573A\u4E4B\u524D\u4F1A\u901A\u77E5\u8C03\u5EA6\u8005\u518D\u53BB<strong>\u8C03\u5EA6\u4E00\u4E2A\u65B0\u7684\u6267\u884C\u8005</strong>\u7EE7\u7EED\u5B8C\u6210\u8FD9\u4E2A\u4EFB\u52A1\uFF0C \u65B0\u7684\u6267\u884C\u8005\u5728\u6267\u884C\u4EFB\u52A1\u65F6\u4F9D\u65E7\u4F1A\u6839\u636E\u65F6\u95F4\u7247\u4E2D\u65AD\u4EFB\u52A1\uFF0C\u7136\u540E\u9000\u573A\uFF0C\u91CD\u590D\u8FD9\u4E00\u8FC7\u7A0B\uFF0C\u76F4\u5230\u5F53\u524D\u8FD9\u4E2A\u4EFB\u52A1\u5F7B\u5E95\u5B8C\u6210\u540E\uFF0C\u5C06\u4EFB\u52A1\u4ECE <code>taskQueue</code> \u51FA\u961F\u3002</p><p><code>taskQueue</code> \u4E2D\u6BCF\u4E00\u4E2A\u4EFB\u52A1\u90FD\u88AB\u8FD9\u6837\u5904\u7406\uFF0C\u6700\u7EC8\u5B8C\u6210\u6240\u6709\u4EFB\u52A1\uFF0C\u8FD9\u5C31\u662F <code>Scheduler</code> \u7684\u5B8C\u6574\u5DE5\u4F5C\u6D41\u7A0B\u3002</p><p>\u8FD9\u91CC\u9762\u6709\u4E00\u4E2A\u5173\u952E\u70B9\uFF0C\u5C31\u662F\u6267\u884C\u8005\u5982\u4F55\u77E5\u9053\u8FD9\u4E2A\u4EFB\u52A1\u5230\u5E95\u5B8C\u6210\u6CA1\u5B8C\u6210\u5462\uFF1F\u8FD9\u662F\u53E6\u4E00\u4E2A\u8BDD\u9898\u4E86\uFF0C\u4E5F\u5C31\u662F\u5224\u65AD\u4EFB\u52A1\u7684\u5B8C\u6210\u72B6\u6001\u3002\u5728\u8BB2\u89E3\u6267\u884C\u8005\u6267\u884C\u4EFB\u52A1\u7684\u7EC6\u8282\u65F6\u4F1A\u91CD\u70B9\u7A81\u51FA\u3002</p><p>\u4EE5\u4E0A\u662F <code>Scheduler</code> \u539F\u7406\u7684\u6982\u8FF0\uFF0C\u4E0B\u9762\u5F00\u59CB\u662F\u5BF9 React \u548C <code>Scheduler</code> \u8054\u5408\u5DE5\u4F5C\u673A\u5236\u7684\u8BE6\u7EC6\u89E3\u8BFB\u3002\u6D89\u53CA React \u4E0E <code>Scheduler</code> \u7684\u8FDE\u63A5\u3001\u8C03\u5EA6\u5165\u53E3\u3001\u4EFB\u52A1\u4F18\u5148\u7EA7\u3001\u4EFB\u52A1\u8FC7\u671F\u65F6\u95F4\u3001\u4EFB\u52A1\u4E2D\u65AD\u548C\u6062\u590D\u3001\u5224\u65AD\u4EFB\u52A1\u7684\u5B8C\u6210\u72B6\u6001\u7B49\u5185\u5BB9\u3002</p><h2 id="\u53C2\u8003\u8D44\u6599" tabindex="-1">\u53C2\u8003\u8D44\u6599 <a class="header-anchor" href="#\u53C2\u8003\u8D44\u6599" aria-hidden="true">#</a></h2><p><a href="https://juejin.cn/post/7077093825990098958" target="_blank" rel="noopener noreferrer">\u4E00\u6587\u89E3\u6790 React Scheduler\u6E90\u7801\u6267\u884C\u539F\u7406</a></p><p><a href="https://juejin.cn/post/7007613737012035592" target="_blank" rel="noopener noreferrer">React\u6E90\u7801\u89E3\u6790\u4E4B Scheduler</a></p><p><a href="https://juejin.cn/post/7087933643821154312" target="_blank" rel="noopener noreferrer">\u6DF1\u5165\u7406\u89E3 scheduler \u539F\u7406</a></p>',40),a=[o];function l(s,i,u,n,h,p){return d(),r("div",null,a)}var m=e(c,[["render",l]]);export{_ as __pageData,m as default};
